                <input type="password" onChange={this.handleChange("password")}  className="form-control" id="exampleInputPassword1" placeholder="Password" />
            </div>
            <div className=""> 
                <button type="submit" onClick={this.clickSubmit} className="btn bg-success">Submit</button>
            </div>
        </form>
    );

    render() {
        const {name, email, password, error } = this.state;

        return (
            <div className="">
                <div className="jumbotron">
                    <h1>SignUp</h1>
                </div>
                <div className="container">
                    { this.SignupForm(name, email, password) }
                </div>
            </div>
        );
    }
}

export default Signup;
